import styled from "styled-components";
import Button from "./Button";

const Item = styled.div`
    font-size: 2em;
    text-align: left;
    margin-top: 1%;
    border: 1px solid;
    border-radius: 10px;
    padding: 1%;
    width: 55%
`

function TodoItem(props) {
    return (
        <Item>
            {props.text}
            <Button
                text="Edit"
                color="#00b8a9"
            />
        </Item>
    );
}

export default TodoItem;
